import React, { Component } from 'react'
import ApiService from '../Service/ApiService'


export class NormalUser extends Component {
    constructor(props) {
        super(props)

        this.state = {
             userid:0,
             task:[]
        }
    }
    componentDidMount()
    {
        const id = this.props.match.params.id
        this.setState({userid:id})
        ApiService.getUserTaskById(this.state.userid).then(res=>{
            console.log(res.data.result)
        }).catch(error=>{console.log(error)})
    }


    render() {
        // const name =this.props.match.params.name

        var mail =JSON.parse(sessionStorage.getItem('userloginmail'))
            var name = mail.fname.concat(" "+mail.lname)



        return (
            <div style={{textAlign:'center',color:'red',fontStyle:'italic'}}>
            <h4>Welcome <br/>{name} (user)</h4> 





                <form>
                    <table className="table table-striped">
                        <tr>
                            <button className="btn btn-success ">Complete</button>
                           </tr>
                           <tr>
                               <th></th>
                                <th>Task Name</th>
                                <th>Description</th>
                                <th>Status</th>
                                <th colSpan="2">Action</th>

                        </tr>
                        <tr>
                            <td><input type="checkbox" /></td>
                            <td>T1</td>
                            <td>task one u have to complete</td>
                            <td>New</td>

                            <td><button className="btn btn-primary">Edit</button></td>
                            <td><button className="btn btn-danger">Delete</button></td>
                        </tr>
                        <tr><button className="btn btn-danger">SignOut</button></tr>
                    </table>

                </form>
            </div>
        )
    }
}

export default NormalUser
